mapper.select:
select a.AJBS,a.AJBH,b.AJMC,DATE_FORMAT(b.LASJ,'%Y-%m-%d %T') LASJ,b.ZBDWMC, e.mc AJZT from GJ_AJJBQK a left JOIN aj_jbxx b on a.AJBH=b.AJBH left join (select c.* from dict_ga c LEFT JOIN dict_ga_sm d on c.DICT_SM_ID=d.id where d.ID=5) e on a.AJZT=e.code where a.AREA_CODE=#{areaCode,jdbcType=VARCHAR}
and b.AJMC like CONCAT('%',#{searchContent,jdbcType=VARCHAR},'%')
and a.AJBH like CONCAT('%',#{searchContent,jdbcType=VARCHAR},'%')

select a.AJBS,a.AJBH,b.AJMC,DATE_FORMAT(b.LASJ,'%Y-%m-%d %T') LASJ,b.ZBDWMC,e.mc AJZT from GJ_AJJBQK a left JOIN aj_jbxx b on a.AJBH=b.AJBH left join (select c.* from dict_ga c LEFT JOIN dict_ga_sm d on c.DICT_SM_ID=d.id where d.ID=5) e on a.AJZT=e.code where a.AREA_CODE=#{areaCode,jdbcType=VARCHAR}
and b.AJMC like CONCAT('%',#{searchContent,jdbcType=VARCHAR},'%')
and b.AJBH like CONCAT('%',#{searchContent,jdbcType=VARCHAR},'%')
